  handleClick=()=>{
    this.props.history.push("/home/first")
  }
  render() {
    console.log("about",this.props);
    return (
      <div>
        <h1>我是 about 组件</h1>
        <button onClick={this.handleClick}>跳转</button>
      </div>
      
    )
  }
}
export default withRouter(About)
